package Memento_Pattern;

public class Memento {
	
	private String Data1;
	private int Data2;

	public Memento(String data1, int data2) {
		this.Data1 = data1;
		this.Data2 = data2;
	}

	public String getData1() {
		return this.Data1;
	}

	public int getData2() {
		// TODO Auto-generated method stub
		return this.Data2;
	}

}
